import sys

def main():
    n, k = map(int, sys.stdin.readline().split())
    s = map(int, sys.stdin.readline().split())
    d = {}
    for i in list(s):
        if i in d:
            d[i] += 1
        else:
            d[i] = 1
    t = []
    while len(t) < k:
        m = max(d, key=d.get)
        t.append(m)
        d[m] -= 1
        if d[m] == 0:
            del d[m]
    print(*t)

if __name__ == '__main__':
    main()

from collections import Counter

n, k = map(int, input().split())
s = list(map(int, input().split()))

c = Counter(s)

t = []
for i in range(k):
    t.append(c.most_common(1)[0][0])
    c[t[-1]] -= 1

print(*t)

